import Add from "../components/add";

const InputSpend = () => {

    return(
        <div className="inputSpendPage">
            <div>
                <Link to="/input_spend">Spend</Link>
                <Link to="/input_income">Income</Link>
            </div>

                <div className="inputBox_grid">
                    <button id="food" value="food"></button>
                    <button id="shop"></button>
                    <button id="home"></button>
                    <button id="lend"></button>
                    <button id="health"></button>
                    <button id="travel"></button>
                    <button id="learn"></button>
                    <button id="fun"></button>
                    <button id="others"></button>         
                </div>
                <Add />
        </div>
    );
}

export default InputSpend;
